在 TypeScript 中，可以使用abstract` 关键字来定义虚拟方法。虚拟方法是一个没有实现的抽象方法，必须在子类中实现。

例如，下面是一个定义了虚拟方法的抽象类的示例：

```typescript
abstract class Animal {
  abstract makeSound(): void;
}

class Dog extends Animal {
  makeSound() {
    console.log('Woof! Woof!');
  }
}

class Cat extends Animal {
  makeSound() {
    console.log('Meow! Meow!');
  }
}

const dog = new Dog();
const cat = new Cat();

dog.makeSound(); // 输出 "Woof! Woof!"
cat.makeSound(); // 输出 "Meow! Meow!"
```

在上面的示例中，`Animal` 类定义了一个虚拟方法 `makeSound()`，它没有实现。`Dog` 和 `Cat` 类都继承了 `Animal` 类实现了 `makeSound()` 方法。当我们创建 `Dog` 和 `Cat` 的实例并调用 `makeSound()` 方法时，会输出相应的声音。

在 TypeScript 中，可以使用 `abstract` 关键字来定义一个抽象类，抽象类中可以包含抽象方法。抽象方法不包含具体实现，只是定义了方法的签名，具体的实现由子类来完成。定义一个抽象方法的语法如下：

```typescript
abstract methodName(param1: type1, param2: type2): returnType;
```

其中，`abstract` 表示该方法是抽象方法，没有具体实现。`methodName` 是方法名，`param1` 和 `param2` 是方法的参数，`type1` 和 `type2` 是参数的类型，`returnType` 是方法的返回值类型。需要注意的是，抽象方法必须在抽象类中定义，而且抽象类不能被实例化，只能被继承。

下面是一个简单的例子：

```typescript
abstract class Animal {
  abstract makeSound(): void;
}

class Dog extends Animal {
  makeSound() {
    console.log('汪汪汪');
  }
}

const dog = new Dog();
dog.makeSound(); // 输出：汪汪汪
```

在上面的例子中，`Animal` 类是一个抽象类，其中定义了一个抽象方法 `makeSound`，子类 `Dog` 继承了 `Animal` 类，并实现了 `makeSound` 方法。最后，创建了一个 `Dog` 类的实例 `dog`，并调用了 `makeSound` 方法，输出了一段文字。
